import SidebarMenu from 'react-bootstrap-sidebar-menu';
import { Outlet, Link } from "react-router-dom";

export default function StudentSideBar(){
    return(
    <SidebarMenu>
        <SidebarMenu.Header>
            <SidebarMenu.Toggle />
        </SidebarMenu.Header>
        <SidebarMenu.Body>
            <SidebarMenu.Nav>
                <Link to="/">Reports</Link>
            </SidebarMenu.Nav>
        </SidebarMenu.Body>
    </SidebarMenu>
    );
}
